econds\":\"3871\",\"keywords\":[\"Ronald Reagan\",\"President Reagan\",\"Nancy Reagan\",\"First Lady\",\"POTUS\",\"FLOTUS\",\"Rich Little\",\"Comedian\",\"Actor\",\"Artist\"],\"channelId\":\"UCEJi23qnygQHE5UeLXoV_JQ\",\"isOwnerViewing\":false,\"shortDescription\":\"Please join us for an evening with comedian, actor, artist and entertainment legend Rich Little, who will be here to discuss his new book, Little by Little: People I’ve Known and Been (Publish Date: August 8, 2016), as well as to share stories of his time spent with President Reagan. Tickets to the event are $56 per person and include a buffet dinner in the Air Force One Pavilion following the program. Books must be purchased in the Reagan Library Museum Store to receive signature.\\n\\nRich Little is a master mimic of more than 200 voices and currently has a Las Vegas Show at the Tropicana Hotel. Rich Little has a voice for every administration including U.S. Presidents: John F. Kennedy, Lyndon Johnson, Richard Nixon, Gerald Ford, Jimmy Carter, Ronald Reagan, Bill Clinton, both George Bushes and Barack Obama. Infamous for his skewering of political figures, Little has charmed, amused, intrigued and gotten the best of politicians from here to his native Canada. He entertained at both of Ronald Reagan’s presidential inaugurations and got to know the Reagans very well during that time. President Reagan used to tell Little, “You do me better than I do.”\\n\\nIn Little by Little, Rich Little shares his story of how he grew up to become an impersonator. In this gem of a book are insights into the likes of many of the great people he had the privilege and fortune to meet and imitate, shining new light on our beloved stars, including a chapter on Ronald Reagan. This is really not a biography, but more of a humorous glimpse of the people he’s impersonated and some of the funny stories that happened along the way.\\n\\nFor more information on the ongoing works of President Reagan's Foundation, please visit http:\/ ittle shares his story of how he grew up to become an impersonator. In this gem of a book are insights into the likes of many of the great people he had the privilege and fortune to meet and imitate, shining new light on our beloved stars, including a chapter on Ronald Reagan. This is really not a biography, but more of a humorous glimpse of the people he’s impersonated and some of the funny stories that happened along the way.\\n\\nFor more information on the ongoing works of President Reagan's Foundation, please visit http:\/\/www.reaganfoundation.org\\n\\nFor more information on donations, visit https:\/\/support.google.com\/youtube\/?p=donate_FAQ\"},\"lengthSeconds\":\"3871\",\"ownerProfileUrl\":\"http:\/\/www.youtube.com\/user\/ReaganFoundation\",\"externalChannelId\":\"UCEJi23qnygQHE5UeLXoV_JQ\",\"isFamilySafe\":true,\"availableCountries\":[\"AD\",\"AE\",\"AF\",\"AG\",\"AI\",\"AL\",\"AM\",\"AO\",\"AQ\",\"AR\",\"AS\",\"AT\",\"AU\",\"AW\",\"AX\",\"AZ\",\"BA\",\"BB\",\"BD\",\"BE\",\"BF\",\"BG\",\"BH\",\"BI\",\"BJ\",\"BL\",\"BM\",\"BN\",\"BO\",\"BQ\",\"BR\",\"BS\",\"BT\",\"BV\",\"BW\",\"BY\",\"BZ\",\"CA\",\"CC\",\"CD\",\"CF\",\"CG\",\"CH\",\"CI\",\"CK\",\"CL\",\"CM\",\"CN\",\"CO\",\"CR\",\"CU\",\"CV\",\"CW\",\"CX\",\"CY\",\"CZ\",\"DE\",\"DJ\",\"DK\",\"DM\",\"DO\",\"DZ\",\"EC\",\"EE\",\"EG\",\"EH\",\"ER\",\"ES\",\"ET\",\"FI\",\"FJ\",\"FK\",\"FM\",\"FO\",\"FR\",\"GA\",\"GB\",\"GD\",\"GE\",\"GF\",\"GG\",\"GH\",\"GI\",\"GL\",\"GM\",\"GN\",\"GP\",\"GQ\",\"GR\",\"GS\",\"GT\",\"GU\",\"GW\",\"GY\",\"HK\",\"HM\",\"HN\",\"HR\",\"HT\",\"HU\",\"ID\",\"IE\",\"IL\",\"IM\",\"IN\",\"IO\",\"IQ\",\"IR\",\"IS\",\"IT\",\"JE\",\"JM\",\"JO\",\"JP\",\"KE\",\"KG\",\"KH\",\"KI\",\"KM\",\"KN\",\"KP\",\"KR\",\"KW\",\"KY\",\"KZ\",\"LA\",\"LB\",\"LC\",\"LI\",\"LK\",\"LR\",\"LS\",\"LT\",\"LU\",\"LV\",\"LY\",\"MA\",\"MC\",\"MD\",\"ME\",\"MF\",\"MG\",\"MH\",\"MK\",\"ML\",\"MM\",\"MN\",\"MO\",\"MP\",\"MQ\",\"MR\",\"MS\",\"MT\",\"MU\",\"MV\",\"MW\",\"MX\",\"MY\",\"MZ\",\"NA\",\"NC\",\"NE\",\"NF\", is time spent with President Reagan. Tickets to the event are $56 per person and include a buffet dinner in the Air Force One Pavilion following the program. Books must be purchased in the Reagan Library Museum Store to receive signature.\n\nRich Little is a master mimic of more than 200 voices and currently has a Las Vegas Show at the Tropicana Hotel. Rich Little has a voice for every administration including U.S. Presidents: John F. Kennedy, Lyndon Johnson, Richard Nixon, Gerald Ford, Jimmy Carter, Ronald Reagan, Bill Clinton, both George Bushes and Barack Obama. Infamous for his skewering of political figures, Little has charmed, amused, intrigued and gotten the best of politicians from here to his native Canada. He entertained at both of Ronald Reagan’s presidential inaugurations and got to know the Reagans very well during that time. President Reagan used to tell Little, “You do me better than I do.”\n\nIn Little by Little, Rich Little shares his story of how he grew up to become an impersonator. In this gem of a book are insights into the likes of many of the great people he had the privilege and fortune to meet and imitate, shining new light on our beloved stars, including a chapter on Ronald Reagan. This is really not a biography, but more of a humorous glimpse of the people he’s impersonated and some of the funny stories that happened along the way.\n\nFor more information on the ongoing works of President Reagan's Foundation, please visit "},{"text":"http://www.reaganfoundation.org","navigationEndpoint":{"clickTrackingParams":"CJABEM2rARgBIhMI4Iaz9aug6QIVJjThCh3Z7AVdSLK-1I7nqtmgqgE=","commandMetadata":{"webCommandMetadata":{"url":"/redirect?q=http%3A%2F%2Fwww.reaganfoundation.org\u0026redir_token=w6s_wsueROPY7g1PfFm2DrtPZFJ8MTU4ODg5MjQ5MUAxNTg4ODA2MDkx\u0026v=qkFlVnHVHzI\u0026event=video_description","rootVe":83769}},"urlEndpoint":{"url":"/redirect?q=http%3A%2F%2Fwww.reaganfoundation.org\u0026redir_token=w6s_wsueROPY7g1PfFm2DrtPZFJ8MTU4ODg5MjQ5MUAxNTg4ODA2 orum with Rich Little — 3/6/2017","lengthSeconds":"3871","keywords":["Ronald Reagan","President Reagan","Nancy Reagan","First Lady","POTUS","FLOTUS","Rich Little","Comedian","Actor","Artist"],"channelId":"UCEJi23qnygQHE5UeLXoV_JQ","isOwnerViewing":false,"shortDescription":"Please join us for an evening with comedian, actor, artist and entertainment legend Rich Little, who will be here to discuss his new book, Little by Little: People I’ve Known and Been (Publish Date: August 8, 2016), as well as to share stories of his time spent with President Reagan. Tickets to the event are $56 per person and include a buffet dinner in the Air Force One Pavilion following the program. Books must be purchased in the Reagan Library Museum Store to receive signature.\n\nRich Little is a master mimic of more than 200 voices and currently has a Las Vegas Show at the Tropicana Hotel. Rich Little has a voice for every administration including U.S. Presidents: John F. Kennedy, Lyndon Johnson, Richard Nixon, Gerald Ford, Jimmy Carter, Ronald Reagan, Bill Clinton, both George Bushes and Barack Obama. Infamous for his skewering of political figures, Little has charmed, amused, intrigued and gotten the best of politicians from here to his native Canada. He entertained at both of Ronald Reagan’s presidential inaugurations and got to know the Reagans very well during that time. President Reagan used to tell Little, “You do me better than I do.”\n\nIn Little by Little, Rich Little shares his story of how he grew up to become an impersonator. In this gem of a book are insights into the likes of many of the great people he had the privilege and fortune to meet and imitate, shining new light on our beloved stars, including a chapter on Ronald Reagan. This is really not a biography, but more of a humorous glimpse of the people he’s impersonated and some of the funny stories that happened along the way.\n\nFor more information on the ongoing works of President Reagan's Foundation, please visit http: nHVHzI?version=3\u0026autohide=1","width":1280,"height":720,"flashSecureUrl":"https://www.youtube.com/v/qkFlVnHVHzI?version=3\u0026autohide=1"},"title":{"simpleText":"A Reagan Forum with Rich Little — 3/6/2017"},"description":{"simpleText":"Please join us for an evening with comedian, actor, artist and entertainment legend Rich Little, who will be here to discuss his new book, Little by Little: People I’ve Known and Been (Publish Date: August 8, 2016), as well as to share stories of his time spent with President Reagan. Tickets to the event are $56 per person and include a buffet dinner in the Air Force One Pavilion following the program. Books must be purchased in the Reagan Library Museum Store to receive signature.\n\nRich Little is a master mimic of more than 200 voices and currently has a Las Vegas Show at the Tropicana Hotel. Rich Little has a voice for every administration including U.S. Presidents: John F. Kennedy, Lyndon Johnson, Richard Nixon, Gerald Ford, Jimmy Carter, Ronald Reagan, Bill Clinton, both George Bushes and Barack Obama. Infamous for his skewering of political figures, Little has charmed, amused, intrigued and gotten the best of politicians from here to his native Canada. He entertained at both of Ronald Reagan’s presidential inaugurations and got to know the Reagans very well during that time. President Reagan used to tell Little, “You do me better than I do.”\n\nIn Little by Little, Rich Little shares his story of how he grew up to become an impersonator. In this gem of a book are insights into the likes of many of the great people he had the privilege and fortune to meet and imitate, shining new light on our beloved stars, including a chapter on Ronald Reagan. This is really not a biography, but more of a humorous glimpse of the people he’s impersonated and some of the funny stories that happened along the way.\n\nFor more information on the ongoing works of President Reagan's Foundation, please visit http://www.reaganfoundation.org\n\nFor
